package com.jsch.component;import java.util.Vector;/** * Created by chenmin on 17/8/23. */public class SSHInfo {    private int returnCode;    private Vector<String> stdout;    SSHInfo(int returnCode, Vector<String> stdout) {        this.returnCode = returnCode;        this.stdout = stdout;    }    public int getReturnCode() {        return this.returnCode;    }    public Vector<String> getStdout() {        return this.stdout;    }    public SSHInfo setReturnCode(int returnCode) {        this.returnCode = returnCode;        return this;    }    public SSHInfo setStdout(Vector<String> stdout) {        this.stdout = stdout;        return this;    }}